import * as React from "react";
import { Button } from "react-native-paper";
import { StyleSheet, Text, View, TextInput } from "react-native";
import { LinearGradient } from "expo-linear-gradient";
import { Image } from "expo-image";

const IPhone147 = () => {
  return (
    <View style={styles.iphone147}>
      <Button
        style={styles.next}
        mode="contained"
        labelStyle={styles.nextBtn}
        contentStyle={styles.nextBtn1}
      >
        Write at least 1 prompt
      </Button>
      <Text style={[styles.of3, styles.of3Typo]}>1 of 3</Text>
      <View style={[styles.progressIndicator, styles.textFieldsPosition]}>
        <View style={[styles.progressIndicator1, styles.progressPosition1]} />
        <LinearGradient
          style={[styles.progressIndicator11, styles.progressPosition1]}
          locations={[0]}
          colors={["#d49797"]}
        />
        <View style={[styles.progressIndicator2, styles.progressPosition]} />
        <View style={[styles.progressIndicator3, styles.progressPosition]} />
      </View>
      <Text style={[styles.newBundle, styles.of3Typo]}>New Bundle</Text>
      <View style={[styles.textFields, styles.textFieldsPosition]}>
        <Text
          style={[styles.writeAPrompt, styles.of3Typo]}
        >{`Write a prompt for the 
contributors`}</Text>
      </View>
      <TextInput
        style={styles.egWhatsOne}
        placeholder="eg. What’s one thing you’ve learned from this person?"
        placeholderTextColor="#cdcdcd"
      />
      <Image
        style={[styles.icon, styles.iconLayout]}
        contentFit="cover"
        source={require("../assets/icon.png")}
      />
      <Image
        style={[styles.iphoneXTopNavbarLight, styles.iconLayout]}
        contentFit="cover"
        source={require("../assets/iphone-x--top-navbar--light7.png")}
      />
      <View style={styles.prompt1Parent}>
        <Text style={styles.prompt1} />
        <Text style={styles.prompt2} />
        <Text style={styles.prompt2} />
      </View>
      <Image
        style={[styles.iphone147Child, styles.iconLayout]}
        contentFit="cover"
        source={require("../assets/vector-141.png")}
      />
      <View style={styles.homeIndicatorLight}>
        <View style={styles.homeIndicator} />
      </View>
    </View>
  );
};

